import React from 'react'
import "./Feed.css"
import CreateIcon from '@mui/icons-material/Create';
function Feed() {
    return (
        <div className="feed">
            <div className="feed_inputContainer">
                <div className="feed_input">
                    <CreateIcon/>
                </div>
            </div>
        </div>
    )
}
export default Feed
